import React from 'react'

const TodoItem = (props) => {
    
    return (
        <div>
            <h1>ToDo List</h1>
    <li><input type="checkbox"/><strong>{props.id}</strong>{props.name} <button>&times;</button></li>
        </div>
    )
}
export default TodoItem;
